string=''

def rev_comp(string):
	output=''
	for i in reversed(range(0,len(string))):
		nucleotide=string[i]
		match nucleotide:
			case 'A':
				output+='T'
			case 'T':
				output+='A'
			case 'C':
				output+='G'
			case 'G':
				output+='C'
	return output
	
x=rev_comp(string)
print(x)